import React, { useState, useEffect } from 'react'
import { useNavigate } from 'react-router-dom'
import axios from '../../utils/axiosConfig'
import { useAuth } from '../../contexts/AuthContext'
import Navbar from '../../components/Navbar'
import { toast } from 'react-toastify'

function PlayerDashboard() {
  const { user } = useAuth()
  const navigate = useNavigate()
  const [categories, setCategories] = useState([])
  const [selectedCategory, setSelectedCategory] = useState('')
  const [selectedDifficulty, setSelectedDifficulty] = useState('medium')
  const [error, setError] = useState('')

  useEffect(() => {
    if (!user) {
      navigate('/login')
      return
    }

    const fetchCategories = async () => {
      try {
        const response = await axios.get('/api/categories')
        setCategories(response.data)
        if (response.data.length > 0) {
          setSelectedCategory(response.data[0]._id)
        }
      } catch (error) {
        const message =
          error.response?.data?.message || 'Failed to load categories'
        setError(message)
        toast.error(message)
        console.error(error)
      }
    }

    fetchCategories()
  }, [user, navigate])

  const handleStartQuiz = () => {
    if (!selectedCategory) {
      toast.warning('Please select a category first')
      return
    }
    navigate(
      `/player/quiz/${selectedCategory}?difficulty=${selectedDifficulty}`
    )
  }

  const handleViewHistory = () => {
    navigate('/player/history')
  }

  const renderDashboardContent = () => (
    <div className="bg-white rounded-lg shadow-md p-6 max-w-2xl mx-auto">
      <h1 className="text-3xl font-bold text-center mb-6 text-purple-600">
        Welcome, {user?.name}!
      </h1>

      <div className="mb-6">
        <h2 className="text-xl font-semibold mb-4">Start a New Quiz</h2>

        {/* Category Selection */}
        <div className="mb-4">
          <label
            className="block text-gray-700 text-sm font-bold mb-2"
            htmlFor="category"
          >
            Select Category
          </label>
          <select
            id="category"
            value={selectedCategory}
            onChange={(e) => setSelectedCategory(e.target.value)}
            className="shadow border rounded w-full py-2 px-3 text-gray-700"
          >
            {categories.map((category) => (
              <option key={category._id} value={category._id}>
                {category.name}
              </option>
            ))}
          </select>
        </div>

        {/* Difficulty Selection */}
        <div className="mb-4">
          <label
            className="block text-gray-700 text-sm font-bold mb-2"
            htmlFor="difficulty"
          >
            Select Difficulty
          </label>
          <select
            id="difficulty"
            value={selectedDifficulty}
            onChange={(e) => setSelectedDifficulty(e.target.value)}
            className="shadow border rounded w-full py-2 px-3 text-gray-700"
          >
            <option value="easy">Easy</option>
            <option value="medium">Medium</option>
            <option value="hard">Hard</option>
          </select>
        </div>

        <button
          onClick={handleStartQuiz}
          className="bg-purple-600 hover:bg-purple-700 text-white font-bold py-2 px-4 rounded w-full"
          disabled={!selectedCategory}
        >
          Start Quiz
        </button>
      </div>

      <div className="border-t pt-6">
        <button
          onClick={handleViewHistory}
          className="bg-gray-600 hover:bg-gray-700 text-white font-bold py-2 px-4 rounded w-full"
        >
          View My History
        </button>
      </div>
    </div>
  )

  return (
    <div className="min-h-screen bg-gray-100">
      <Navbar />
      <div className="container mx-auto px-4 py-8">
        {error ? (
          <div className="bg-red-100 border border-red-400 text-red-700 px-4 py-3 rounded mb-4">
            {error}
          </div>
        ) : (
          renderDashboardContent()
        )}
      </div>
    </div>
  )
}

export default PlayerDashboard
